import React, { useState } from 'react';
import './style.css';

function Homes() {
  const [animate, setAnimate] = useState(false);

  const handleClick = () => {
    setAnimate(true);
    setTimeout(() => {
      setAnimate(false);
    }, 10000);
  };

  return (
    <section className="home">
      <button className={`order ${animate ? 'animate' : ''}`} onClick={handleClick}>
        Click me
      </button>
    </section>
  );
}

export default Homes;
